import json
import pathlib
import random

from ipyleaflet import GeoJSON, Map
from shiny import App, reactive, ui, render
from shinywidgets import output_widget, render_widget

# Load the GeoJSON file
here = pathlib.Path(__file__)
with open(here.parent / "filtered_output.geojson", "r") as f:
    country_boundaries = json.load(f)

def random_color(feature):
    return {
        "color": "black",
        "fillColor": random.choice(["red", "yellow", "green", "orange"]),
    }

# UI
app_ui = ui.page_sidebar(
    ui.sidebar(
        ui.h2("NJ County Map"),
        ui.div(
            output_widget("map"),
            style="height: 400px; width: 100%;"
        ),
        ui.hr(),
        ui.h4("Selected County:"),
        ui.output_text("county_name"),
        bg="#f8f8f8",
        width="30vw"
    ),
    ui.div(
        ui.div(
            ui.h3("📊 Indicator 1"),
            "Content for Indicator 1",style="""
                text-align: center;
                background-color: #e0e6ff;
                border: 2px solid #b3b8ff;
                border-radius: 15px;
                padding: 20px;
                margin-bottom: 20px;
            """
        ),
        ui.div(
            ui.h3("📊 Indicator 2"),
            "Content for Indicator 2"
        ),
        ui.div(
            ui.h3("📊 Indicator 3"),
            "Content for Indicator 3"
        ),
        ui.div(
            ui.h3("📊 Indicator 4"),
            "Content for Indicator 4"
        ),
        ui.div(
            ui.h3("📊 Indicator 5"),
            "Content for Indicator 5"
        ),
        ui.div(
            ui.h3("📊 Indicator 6"),
            "Content for Indicator 6"
        ),
        ui.div(
            ui.h3("📊 Indicator 7"),
            "Content for Indicator 7"
        ),
        ui.div(
            ui.h3("📊 Indicator 8"),
            "Content for Indicator 8"
        ),
        ui.div(
            ui.h3("📊 Indicator 9"),
            "Content for Indicator 9"
        ),
        ui.div(
            ui.h3("📊 Indicator 10"),
            "Content for Indicator 10"
        ),
        ui.div(
            ui.h3("📊 Indicator 11"),
            "Content for Indicator 11"
        ),
        ui.div(
            ui.h3("📊 Indicator 12"),
            "Content for Indicator 12"
        ),
        ui.div(
            ui.h3("📊 Indicator 13"),
            "Content for Indicator 13"
        ),
        style="padding: 20px;"
    )
)

# Server
def server(input, output, session):
    selected_county = reactive.Value("None")

    @render_widget
    def map():
        m = Map(center=(40.2060882, -74.7661658), zoom=8, tiles="CartoDB Positron")

        geo_json = GeoJSON(
            data=country_boundaries,
            style={
                "opacity": 1,
                "dashArray": "9",
                "fillOpacity": 0.1,
                "weight": 1,
            },
            hover_style={"color": "black", "dashArray": "0", "fillOpacity": 0.5},
            style_callback=random_color,
        )

        def handle_click(event, feature, **kwargs):
            name = feature["properties"].get("NAME", "Unknown")
            selected_county.set(name)

        geo_json.on_click(handle_click)
        m.add_layer(geo_json)
        return m

    @output
    @render.text
    def county_name():
        return selected_county()

# App
app = App(app_ui, server)
